; Skeleton of an ASM source code in Z80
; ... with all basic useful functions to display an image in overscan
; ... using the bank #8000-#c000: it saves and restores system, stack, etc. for a smooth end of program (by pressing the space bar).
; Can be compiled with WinAPE.
; Re-use me!

	ORG #1000

EOL		EQU #ff

STACK_ADDRESS	EQU #100

BANK_SYSTEM	EQU #c4

SCREEN_WIDTH    EQU #30
SCREEN_CHARS	EQU SCREEN_WIDTH * 2
SCREEN_SHIFT	EQU 16		; Let's start #8000 a bit to the right, so #c000 is aligned with the left border
SCREEN_HEIGHT	EQU 168 * 2	; Actually, 168 (#8000) + 104 (#c000)

OVERSCAN_POS_Y	EQU #8000 + SCREEN_SHIFT + SCREEN_SHIFT

_INIT
	; Stop interruptions & change SP
	DI
	LD hl, (#38)
	LD (__int), hl
	LD hl, #c9fb
	LD (#38), hl
	LD (__stack), sp
	LD sp, STACK_ADDRESS
	EXX
	PUSH hl
	PUSH de
	PUSH bc
	PUSH af
	PUSH ix
	PUSH iy
	EXX
	EI

	; Save system
	LD bc, #7f00 + BANK_SYSTEM
	OUT (c), c
	LD hl, #a6fc
	LD de, #66fc
	LD bc, #1904
	LDIR
	LD bc, #7fc0
	OUT (c), c

	; Clear the video memory
	LD hl, #8000
	LD de, #8001
	LD (hl), l
	LD bc, #3fff
	LDIR
	LD hl, #c000
	LD de, #c001
	LD (hl), l
	LD bc, #3fff
	LDIR

	; Set mode & colors
	LD bc, #7F8C	; MODE 0
	OUT (c), c
	LD hl, __color
	CALL _COLOR

	; Reformat screen size
	LD hl, __crtc
	CALL _CRTC_REGISTER

	; Precalculation of screen addresses
	CALL _PRECALC_OVERSCAN_BC26

	; Display the fullscreen image
	CALL _DISPLAY_IMAGE

;
; ***
; Program starts
_START
_VBL
	LD b, #f5
	IN a, (c)
	RRA
	JP NC, $ - 3

_KEY
	LD bc, #f40e
	OUT (c), c
	LD bc, #f6c0
	OUT (c), c
	XOR a
	OUT (c), a
	LD bc, #f792
	OUT (c), c
	LD bc, #f645
	OUT (c), c
	LD b, #f4
	IN a, (c)
	LD bc, #f782
	OUT (c), c
	LD bc, #f600
	OUT (c), c
	RLA
	JP C, _VBL
_END

	; Reformat screen size
	LD hl, __crtc_orig
	CALL _CRTC_REGISTER

	; Restore system
	LD bc, #7f00 + BANK_SYSTEM
	OUT (c), c
	LD hl, #66fc
	LD de, #a6fc
	LD bc, #1904
	LDIR
	LD bc, #7fc0
	OUT (c), c

	; Restore interruptions & stack
	DI
	EXX
	POP iy
	POP ix
	POP af
	POP bc
	POP de
	POP hl
	EXX
	LD sp, (__stack)
	LD hl, (__int)
	LD (#38), hl
	EI

	; Restore screen pointer
	LD bc, #bc0c
	OUT (c), c
	INC b
	LD c, #30
	OUT (c),c

	; Set mode & colors
	LD a, 1
	CALL #bc0e	; MODE 1

    	RET
; Program ends
; ***

; ***
; Set CRTC registers
; 'hl'= address of the registers to apply (list of [register ID, value]. EOL to end)
; 'bc', 'a' are modified
_CRTC_REGISTER
	LD a, (hl)
	CP EOL
	RET Z
	LD b, #bc
	OUT (c), a
	INC hl
	LD a, (hl)
	INC b
	OUT (c), a
	INC hl
	JR _CRTC_REGISTER

; ***
; Set colors
; 'hl'= address of list of colors to apply (first border, then the rest. EOL to end)
; 'bc', 'a' are modified
_COLOR
	LD bc, #7f10
	OUT (c), c
	LD a, (hl)
	OUT (c), a
	INC hl
	LD c, 0
_COLOR__WHILE
	LD a, (hl)
	CP EOL
	RET Z
	OUT (c), c
	OUT (c), a
	INC c
	INC hl
	JR _COLOR__WHILE

; ***
; BC26. Works with any address bank
; 'hl'= screen address 
; 'a' is modified
_BC26
	LD a, h
        ADD a, #08
        LD h, a
        AND #38 
        RET NZ 
        LD a, h
        SUB #40
        LD h, a
        LD a, l
        ADD a, SCREEN_CHARS
        LD l, a
        RET NC
        INC h
        LD a, h
        AND #07
        RET NZ
        LD a, h
        SUB #08
        LD h, a
        RET

; ***
; BC29. Works with any address bank
; 'hl'= screen address 
; 'a' is modified
_BC29 
	LD a, h
	SUB #08
	LD h, a
	AND #38
	CP #38
	RET NZ
	LD a, h
	ADD #40
	LD h, a
	LD a, l
	SUB SCREEN_CHARS
	LD l, a
	RET NC
	DEC h
	LD a, h
	AND #07
	RET NZ
	LD a, h
	ADD #08
	LD h, a
	RET

; ***
; Precalc screen addresses in overscan, if you need a quick BC26 or easily move from #8000 to #c000
; 'hl', 'ix', 'b' are modified
_PRECALC_OVERSCAN_BC26
	LD ix, __overscan_bc26

	LD hl, OVERSCAN_POS_Y
	LD b, SCREEN_HEIGHT / 2
	CALL _PRECALC_OVERSCAN_BC26__NEXT_LINES

	LD hl, #c000
	LD b, SCREEN_HEIGHT / 2
	CALL _PRECALC_OVERSCAN_BC26__NEXT_LINES

	RET

_PRECALC_OVERSCAN_BC26__NEXT_LINES
	LD (ix + 0), l
	LD (ix + 1), h
	INC ix
	INC ix
	CALL _BC26
	DJNZ _PRECALC_OVERSCAN_BC26__NEXT_LINES
	RET

; ***
; Multiply an unsigned 16 bits numbers by a 8 bits one.
; 'de'= number 1, 'a'= number 2, result in 'hl'
_MULTIPLY_WORD_BY_BYTE
	LD hl, 0
	OR a
	RET Z
	ADC hl, de
	RET Z
	PUSH af
	PUSH de
	LD hl, 0
_MULTIPLY_WORD_BY_BYTE__LOOP
	BIT 0, a
	JR Z, $ + 3
	ADD hl, de
	EX hl, de
	ADD hl, hl
	EX hl, de
	SRL a
	OR A
	JR NZ, _MULTIPLY_WORD_BY_BYTE__LOOP
	POP de
	POP af
	RET

; ***
; Display the image. To be replaced
_DISPLAY_IMAGE
	LD ix, __overscan_bc26
	LD hl, __image
	LD bc, 272
_DISPLAY_IMAGE__NEXT_LINE
	PUSH bc
	LD e, (ix + 0)
	INC ix
	LD d, (ix + 0)
	INC ix
	LD bc, 96
	LDIR
	POP bc
	DEC bc
	LD a, b
	OR c
	JR NZ, _DISPLAY_IMAGE__NEXT_LINE
	RET

; ***
; Data
__int
	DW 0000

__stack
	DW 0000

__crtc
	DB 00, #3f		; Horizontal 64 CRTC characters (default)
	DB 01, SCREEN_WIDTH	; Width of display window
	DB 02, 50		; Horizontal sync position
	DB 03, #8e		; Horizontal & vertical sync widths (default)
	DB 04, 38		; Vertical 39 CRTC character-lines (default)
	DB 05, 00		; Vertical adjust (default)
	DB 06, 35		; Height of display window
	DB 07, 35		; Vertical sync position
	DB 08, 00		; Interlace & skew (default)
	DB 09, 07		; Character height to 8 scanlines (default)
	DB 12, #2c		; Display start + size (#8000-#ffff)
	DB 13, SCREEN_SHIFT	; #c000 starts at the left border of the screen
	DB EOL
__crtc_orig
	DB 00, #3f, 01, #28, 02, #2e, 03, #8e, 04, #26, 05, #00 
	DB 06, #19, 07, #1e, 08, #00, 09, #07, 12, #30, 12, #00
	DB EOL

__color
	DB #54	; border
	DB #54, #4C, #5C, #4E, #43, #4A, #5E, #47, #46, #5E, #5F, #47, #52, #59, #44, #5F
	DB EOL

__overscan_bc26
	DS SCREEN_HEIGHT * 2

